import { StyleSheet } from "react-native";

export const global = StyleSheet.create({
    h1: {
        fontFamily: 'sans-bold',
        fontSize: 36,
        color: '#1E1E1E',
        paddingBottom: 10,
    },
    h2: {
        fontFamily: 'sans-bold',
        color: '#1E1E1E',
        fontSize: 20
    },
    p: {
        fontFamily: 'sans-medium',
        fontSize: 16,
        color: 'rgba(30, 30, 30, 0.63)'
    },
    p2:{
        fontFamily: 'sans-medium',
        fontSize: 12,
        color: 'rgba(30, 30, 30, 0.63)'
    }
})
